import React from 'react';
import { AppBar, Toolbar, Button, Typography } from '@mui/material';
import { Link } from 'react-router-dom';
import './Home.css';
import logo from '../Images/logo_image.jpg'; // Adjust the path based on the actual image name

const Home = () => {
  return (
    <div className="home">
      {/* Navbar */}
      <div className="appBarWrapper">
        <AppBar position="static" sx={{ backgroundColor: '#d84315', borderRadius: '30px' }}>
          <Toolbar className="toolbar">
            <Typography variant="h6" className="title">
              Her Power, Her Past
            </Typography>
            <div>
              <Button
                component={Link}
                to="/"
                color="inherit"
                sx={{ fontSize: '1.2rem', padding: '10px 20px', marginLeft: '15px' }}
              >
                Home
              </Button>
              <Button
                component={Link}
                to="/blogs"
                color="inherit"
                sx={{ fontSize: '1.2rem', padding: '10px 20px', marginLeft: '15px' }}
              >
                Blogs
              </Button>
              <Button
                component={Link}
                to="/about"
                color="inherit"
                sx={{ fontSize: '1.2rem', padding: '10px 20px', marginLeft: '15px' }}
              >
                About
              </Button>
            </div>
          </Toolbar>
        </AppBar>
      </div>

      {/* Centered Logo */}
      <div className="center-logo">
        <img src={logo} alt="Logo" className="logo-image" />
      </div>

      <div className="content">
        <h1>Welcome to the Home Page</h1>
        <p>This is the home page of the website styled with warm red/orange tones.</p>
      </div>
    </div>
  );
};

export default Home;
